def compute_ortho(young_1,young_2,young_3,poisson_12,poisson_23,poisson_31,shear_12,shear_13,shear_23,n):
	poisson_21 = young_2 * poisson_12 / young_1
	poisson_32 = young_3 * poisson_23 / young_2
	poisson_13 = young_1 * poisson_31 / young_3


	gamma = 1 / (1 - poisson_12 * poisson_21 - poisson_23 * poisson_32 - poisson_31 * poisson_13 - 2 * poisson_21 * poisson_32 * poisson_13)

	c11 = young_1 * (1 - poisson_23 * poisson_32) * gamma
	c22 =  young_2 * (1 - poisson_13 * poisson_31) * gamma
	c33 = young_3 * (1 - poisson_12 * poisson_21) * gamma
	c12 = young_1 * (poisson_21 + poisson_31 * poisson_23) * gamma #( OR young_2 * (poisson_12 + poisson_32 * poisson_13) * gamma )
	c13 = young_1 * (poisson_31 + poisson_21 * poisson_32) * gamma #( OR young_3 * (poisson_13 + poisson_12 * poisson_23) * gamma ) 
	c23 = young_2 * (poisson_32 + poisson_12 * poisson_31) * gamma #( OR young_3 * (poisson_23 + poisson_21 * poisson_13) * gamma)
	c44 = shear_23
	c55 = shear_13
	c66 = shear_12

	C = np.array([[c11,c12,c13,0,0,0],
				  [c12,c22,c23,0,0,0],
				  [c13,c23,c33,0,0,0],
				  [ 0,  0,  0 ,c44,0,0],
				  [ 0,  0,  0,  0,c55,0],
				  [ 0,  0,  0,  0,  0,c66]])

	B= np.array([[c11,c12,c13],
				 [c12,c22,c23],
				 [c13,c23,c33]])

	values , vectors = eig(B)

	_lambda1 = values[0]
	_lambda2 = values[1]
	_lambda3 = values[2]
	_lambda4 = 2*c44
	_lambda5 = 2*c55
	_lambda6 = 2*c66



	n = np.divide(n,np.linalg.norm(n))
	v1 = np.array([0,0,0])
	v2 = np.array([0,0,0])

	if ((n[0]!=0) or (n[1]!=0)): 
	    v1=[-n[1],n[0],n[2]]
	else:
	    v1=[1,0,0]

	v1= np.cross(n,v1)

	v1 = np.divide(v1,np.linalg.norm(v1))
	v2= np.cross(v1,n)

	def matrixD(_lambda,v1,v2,n):
		val1_D = c12*c23 - c13 * (c22 - _lambda)
		val2_D = c12*c13 - c23 * (c11 - _lambda)
		val3_D = (c11 - _lambda)*(c22 - _lambda) - c12**2

		return val1_D * np.outer(v1,v1) + val2_D * np.outer(v2,v2) + val3_D * np.outer(n,n)

	def matrixZ(_lambda_k,_lambda_i,_lambda_j):
		return 1 / ( (_lambda_k - _lambda_i)*(_lambda_k - _lambda_j)*(c12*(c13**2 - c23**2) - c13*c23*(c11 - c22))
					 * ( (c12*c13 - c23*(c11 - _lambda_i))*( (c11 - _lambda_j)  + c12 + c13) )
					 - (c12*c23 - c13*(c22 - _lambda_i))*(c12 + (c22 - _lambda_j) + c23) )
	

	N1_orth = matrixZ(_lambda1,_lambda2,_lambda3) * matrixD(_lambda1,v1,v2,n)
	# N1_orth *= np.linalg.norm( N1_orth)
	N1_orth /= sqrt(N1_orth[0][0]**2+N1_orth[1][1]**2+N1_orth[2][2]**2)

	N2_orth = matrixZ(_lambda2,_lambda3,_lambda1) * matrixD(_lambda2,v1,v2,n)
	# N2_orth *= np.linalg.norm( N2_orth)
	N2_orth /= sqrt(N2_orth[0][0]**2+N2_orth[1][1]**2+N2_orth[2][2]**2)

	N3_orth = matrixZ(_lambda3,_lambda1,_lambda2) * matrixD(_lambda3,v1,v2,n)
	# N3_orth *= np.linalg.norm( N3_orth)
	N3_orth /= sqrt(N3_orth[0][0]**2+N3_orth[1][1]**2+N3_orth[2][2]**2)
	
	N1_s = 1 / sqrt(2) * (np.outer(v2,n) + np.outer(n,v2))
	N2_s = 1 / sqrt(2) * (np.outer(n,v1) + np.outer(v1,n))
	N3_s = 1 / sqrt(2) * (np.outer(v1,v2) + np.outer(v2,v1))

	return [_lambda1,_lambda2,_lambda3,_lambda4,_lambda5,_lambda6],[N1_orth,N2_orth,N3_orth,N3_s,N1_s,N2_s]

def compute_transverse_e3(young_1,young_3,poisson_12,poisson_23,poisson_31,shear_12,shear_13,n): 
	# young_1	 -> young_t : 		mean(young_y,young_z)
	# young_3	 -> young_l : 		young_x
	# poisson_12 -> poisson_t : 	poisson_yz
	# poisson_23 -> poisson_tl : 	poisson_zx
	# poisson_31 -> poisson_lt : 	poisson_xy
	# shear_12	 -> shear_t : 		shear_yz
	# shear_13	 -> shear_l : 		mean(shear_zx,shear_xy)
	young_2 = young_1
	shear_23 = shear_13 

	poisson_21 = poisson_12
	poisson_32 = poisson_31
	poisson_13 = poisson_23

	gamma = 1.0 / (1.0 - poisson_12 * poisson_21 - poisson_23 * poisson_32 - poisson_31 * poisson_13 - 2 * poisson_21 * poisson_32 * poisson_13)

	c11 = young_1 * (1.0 - poisson_23 * poisson_32) * gamma
	c22 =  young_2 * (1.0 - poisson_13 * poisson_31) * gamma
	c33 = young_3 * (1.0 - poisson_12 * poisson_21) * gamma
	c12 = young_1 * (poisson_21 + poisson_31 * poisson_23) * gamma #( OR young_2 * (poisson_12 + poisson_32 * poisson_13) * gamma )
	c13 = young_1 * (poisson_31 + poisson_21 * poisson_32) * gamma #( OR young_3 * (poisson_13 + poisson_12 * poisson_23) * gamma ) 
	c23 = young_2 * (poisson_32 + poisson_12 * poisson_31) * gamma #( OR young_3 * (poisson_23 + poisson_21 * poisson_13) * gamma)
	c44 = shear_23
	c55 = shear_13
	c66 = shear_12

	C = np.array([[c11,c12,c13,0.,0.,0.],
				  [c12,c22,c23,0.,0.,0.],
				  [c13,c23,c33,0.,0.,0.],
				  [ 0.,  0.,  0. ,c44,0.,0.],
				  [ 0.,  0.,  0.,  0.,c55,0.],
				  [ 0.,  0.,  0.,  0.,  0.,c66]])

	talpha = sqrt(2.0) * (c11 + c12 - c33) / (4.0 * c13)

	alpha = atan(talpha)
	salpha = sin(alpha)
	calpha = cos(alpha)
	secalpha = 1/calpha

	_lambda1 = c33 + sqrt(2.0) * c13 * (talpha + secalpha)
	_lambda2 = c11 - c12
	_lambda3 = c11 - c12
	_lambda4 = c33 + sqrt(2.0) * c13 * (talpha - secalpha)
	_lambda5 = 2*c55
	_lambda6 = 2*c55



	n = np.divide(n,np.linalg.norm(n))
	v1 = np.array([0.,0.,0.])
	v2 = np.array([0.,0.,0.])

	if ((n[0]!=0.) or (n[1]!=0.)): 
	    v1=[-n[1],n[0],n[2]]
	else:
	    v1=[1.,0.,0.]

	v1 = np.cross(n,v1)

	v1 = np.divide(v1,np.linalg.norm(v1))
	v2 = np.cross(v1,n)
	v3 = n

	val1_Nh1 = (1.0 + salpha)/2.0 + sqrt(2.0)/4.0 * calpha
	val2_Nh1 = (1.0 - salpha)/2.0 + sqrt(2.0)/2.0 * calpha
	N1_hexa = val1_Nh1 * ( np.outer(v1,v1) + np.outer(v2,v2) ) + val2_Nh1 * np.outer(n,n)

	val1_Nh2 = (1.0 - salpha)/2.0 - sqrt(2.0)/4.0 * calpha
	val2_Nh2 = (1.0 + salpha)/2.0 - sqrt(2.0)/2.0 * calpha
	N2_hexa = val1_Nh2 * ( np.outer(v1,v1) + np.outer(v2,v2) ) + val2_Nh2 * np.outer(n,n)

	# normalization Nh1/Nh2
	N1_hexa /= sqrt(2.0*val1_Nh1*val1_Nh1+val2_Nh1*val2_Nh1)
	N2_hexa /= sqrt(2.0*val1_Nh2*val1_Nh2+val2_Nh2*val2_Nh2)

	Np = (np.outer(v1,v1)-np.outer(v2,v2))/sqrt(2.0)
	Ns1 = (np.outer(v2,n)+np.outer(n,v2))/sqrt(2.0)
	Ns2 = (np.outer(v1,n)+np.outer(n,v1))/sqrt(2.0)
	Ns3 = (np.outer(v1,v2)+np.outer(v2,v1))/sqrt(2.0)

	return [_lambda1,_lambda2,_lambda3,_lambda4,_lambda5,_lambda6],[N1_hexa,Np,Ns3,N2_hexa,Ns1,Ns2]

